import { Helmet } from 'react-helmet';

const Games = () => (
  <>
    <Helmet>
      <title>Games | Game Rules</title>
    </Helmet>
    <h1>Games</h1>
    <h2>Submit a game request:</h2>
    <form action="">
      <input type="text" />
      <input type="submit" value="Submit" />
    </form>
  </>
);

export default Games;
